import React, {Component} from 'react';

class NavBar extends Component{
	state = {
		width:100,
		height:50,
		backgroundColor:'grey',
	}

	render(){
		return(
			<div style={state}className="navbar">
				<h1></h1>
			</div>
		);
	}
}

export default NavBar;
